sq--src-components-banner-1-js.query:
query profileImage {
  file(relativePath: {eq: "sudip.png"}) {
    childImageSharp {
      sizes(maxWidth: 450, maxHeight: 450) {
        ...GatsbyImageSharpSizes
      }
    }
  }
}

fragment GatsbyImageSharpSizes on ImageSharpSizes {
  base64
  aspectRatio
  src
  srcSet
  sizes
}

sq--src-components-project-js.query:
query projectList {
  allProjectsJson {
    edges {
      node {
        name
        link
        description
        id
        image {
          childImageSharp {
            fluid(maxHeight: 250) {
              ...GatsbyImageSharpFluid
            }
          }
        }
      }
    }
  }
}

fragment GatsbyImageSharpFluid on ImageSharpFluid {
  base64
  aspectRatio
  src
  srcSet
  sizes
}

